import React from "react";
import Task from "../../../../react-js/src/components/Task";
import './TaskList.css';
const TaskList = () => {

    const mapTasks = () =>{
        return props.tasks.map((task) => (
            <Task
              key={task.id}
              id={task.id}
              projectName={task.projectName}
              taskName={task.taskName}
              status={task.status}
            />
          ));
    }

  return (
    <div>
      <table class="content-table">
        <thead>
          <tr>
            <th>Rank</th>
            <th>Name</th>
            <th>Points</th>
            <th>Team</th>
          </tr>
        </thead>
        <tbody>

            {mapTasks()}
          <tr>
            <td>1</td>
            <td>Domenic</td>
            <td>88,110</td>
            <td>dcode</td>
          </tr>
          <tr>
            <td>2</td>
            <td>Sally</td>
            <td>72,400</td>
            <td>Students</td>
          </tr>
          <tr>
            <td>3</td>
            <td>Nick</td>
            <td>52,300</td>
            <td>dcode</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default TaskList;
